import React from 'react';
import profilePhoto from '../../assets/photos/profilePhoto.png';
import dogPhoto from '../../assets/photos/dogPhoto.png';
import weddingPhoto from '../../assets/photos/weddingPhoto.png';

const About = () => {
	return (
		<div className="">
			<img src={profilePhoto} />
			<h1>I'm an energetic and goofy lad living in Nashville, TN with my super cool wife & beloved furballs.</h1>
			<div className="mainPhotoContainer">
				<div className="photoContainer">
					<img src={weddingPhoto} />
					<h3>In November of 2014 I married my best friend, Bethany.</h3>
				</div>
				<div className="photoContainer">
					<img src={dogPhoto} />
					<h3>Cady (Boston Terrier) & George (Puggle) in their natural habitat, chilling.</h3>
				</div>
			</div>
		</div>
	);
};

export default About;
